-- Volcando estructura para procedimiento valorizacion.pa_ambiente_eliminar
DROP PROCEDURE IF EXISTS `pa_ambiente_eliminar`;
DELIMITER //
CREATE PROCEDURE `pa_ambiente_eliminar`(IN `idambiente` INT(11), IN `idusuario` INT(11), OUT `rpta` INT(11), OUT `titulomsje` VARCHAR(100), OUT `contenidomsje` VARCHAR(100))
BEGIN
	UPDATE tm_ambiente SET Activo = 0, IdUsuarioAct = idusuario, FechaAct = NOW() WHERE tm_idambiente = idambiente;
	SET rpta = idambiente;
	SET titulomsje = 'Eliminado correctamente';
	SET contenidomsje = 'La operación se completó satisfactoriamente';
END//
DELIMITER ;

-- Volcando estructura para procedimiento valorizacion.pa_ambiente_listar
DROP PROCEDURE IF EXISTS `pa_ambiente_listar`;
DELIMITER //
CREATE PROCEDURE `pa_ambiente_listar`(IN `tipo` VARCHAR(10), IN `idempresa` INT(11), IN `idcentro` INT(11), IN `id` INT(11), IN `criterio` VARCHAR(150), IN `pagina` INT(11))
BEGIN
	
	

	IF tipo = '1' THEN
		

		SELECT tm_idambiente, tm_codigo, tm_nombre, FechaReg FROM tm_ambiente WHERE tm_idempresa = idempresa AND tm_idcentro = idcentro AND tm_nombre LIKE CONCAT('%', criterio, '%') AND Activo = 1 ; 
	ELSEIF tipo = '2' THEN
		SELECT tm_idambiente, tm_codigo, tm_nombre FROM tm_ambiente WHERE tm_idambiente = id;
	END IF;
END//
DELIMITER ;

-- Volcando estructura para procedimiento valorizacion.pa_ambiente_registrar
DROP PROCEDURE IF EXISTS `pa_ambiente_registrar`;
DELIMITER //
CREATE PROCEDURE `pa_ambiente_registrar`(IN `idambiente` INT(11), IN `idempresa` INT(11), IN `idcentro` INT(11), IN `codigo` VARCHAR(4), IN `nombre` VARCHAR(100), IN `idusuario` INT(11), OUT `rpta` INT(11), OUT `titulomsje` VARCHAR(100), OUT `contenidomsje` VARCHAR(100))
BEGIN
	IF idambiente = 0 THEN 

		SELECT LAST_INSERT_ID() INTO rpta;
		SET titulomsje = 'Registrado correctamente';
	ELSE
		UPDATE `tm_ambiente`
		SET  `tm_codigo` = codigo,
			`tm_nombre` = nombre,
			`IdUsuarioAct` = idusuario,
			`FechaAct` = NOW()
		WHERE tm_idambiente	 = idambiente;
		
		SET rpta = idambiente;
		SET titulomsje = 'Editado correctamente';
	END IF;
	
	SET contenidomsje = 'La operación se completó satisfactoriamente';
END//
DELIMITER ;

