-- Volcando estructura para procedimiento valorizacion.pa_centrocosto_adicionar
DROP PROCEDURE IF EXISTS `pa_centrocosto_adicionar`;
DELIMITER //
CREATE PROCEDURE `pa_centrocosto_adicionar`()
BEGIN
	DECLARE _cencos_star varchar(12);
	DECLARE _descripcion varchar(100);
	BEGIN

		DECLARE done BOOLEAN DEFAULT FALSE;

		DECLARE CTotales CURSOR FOR  
		SELECT tm_cencos_star, tm_descripcion from tmp_centrocosto   
		where tm_cencos_star not in (select tm_cencos_star from tm_centrocosto  where Activo = '1'); 
				
		DECLARE CONTINUE HANDLER FOR NOT FOUND SET done = TRUE;
	
		OPEN CTotales;
		
		   CTotales_loop: LOOP
	
			Fetch CTotales into _cencos_star, _descripcion ;
		        	
					IF `done` THEN 
		        		LEAVE CTotales_loop; 
		        	END IF; 
		        	
				    VALUES (1, 1, _cencos_star, _descripcion, 1, 1, NOW(), 1, NOW());
					
			END LOOP CTotales_loop;
		
		CLOSE CTotales;
	END;
END//
DELIMITER ;

