-- Volcando estructura para procedimiento valorizacion.pa_cerrar_periodo
DROP PROCEDURE IF EXISTS `pa_cerrar_periodo`;
DELIMITER //
CREATE PROCEDURE `pa_cerrar_periodo`(
	IN `Periodopro` INT)
BEGIN
	
	DECLARE _inventario integer;
	DECLARE _periodo integer;	
	DECLARE _centro1 integer;	
	DECLARE _centro2 integer;
	DECLARE _producto integer;
	DECLARE _cant_ant decimal(10,4);
	DECLARE _cant_envi decimal(10,4);
	DECLARE _cant_inve decimal(10,4);
	DECLARE _costo decimal(10,4);
	DECLARE consumido decimal(10,4);
	DECLARE fechainicial datetime;
	
	BEGIN
		DECLARE done BOOLEAN DEFAULT FALSE;
		
		DECLARE CPeriodo CURSOR FOR  
		
		SELECT a.td_idinventario, a.tm_idperiodo, a.tm_idproducto, a.tm_cant_ant, 
		a.tm_cant_envi, a.tm_cant_inve, b.tm_costo from td_idinventario a  
			inner join tm_costo_producto b on a.tm_idproducto = b.tm_idproducto and a.tm_idperiodo = b.tm_idperiodo 
		where a.tm_idperiodo = Periodopro and  a.Activo = 1 ;

		DECLARE CONTINUE HANDLER FOR NOT FOUND SET done = TRUE;
	
		OPEN CPeriodo;
		
		   CPeriodo_loop: LOOP
	
			Fetch CPeriodo into _inventario, _periodo, _producto, _cant_ant, _cant_envi, _cant_inve, _costo;
		        	
					IF `done` THEN 
		        		LEAVE CPeriodo_loop; 
		        	END IF; 
					
					set consumido = (_cant_ant + _cant_envi - _cant_inve) * _costo ;

					UPDATE td_inventario SET tm_cant_cons = consumido , tm_val_cons = consumido *_costo where td_idinventario = _inventario ;  

				
			END LOOP CPeriodo_loop;
		
		CLOSE CPeriodo;
	END;

END//
DELIMITER ;

