-- Volcando estructura para procedimiento valorizacion.pa_cliente_listar
DROP PROCEDURE IF EXISTS `pa_cliente_listar`;
DELIMITER //
CREATE PROCEDURE `pa_cliente_listar`(IN `tipo` CHAR(1), IN `id` INT(11), IN `criterio` VARCHAR(100), IN `pagina` INT(11))
BEGIN
	DECLARE firstLimit INT(11) DEFAULT 42;
	DECLARE vstart INT(11) DEFAULT 0;
	
	IF tipo = '1' THEN
		set vstart = (pagina * firstLimit) - firstLimit;
		select * from clientes 
			WHERE  tm_descripcion LIKE CONCAT('%', criterio, '%')  AND Activo = 1
			ORDER BY tm_descripcion  
			LIMIT vstart, firstLimit;
	ELSEIF tipo = '2' THEN
		select * FROM clientes WHERE tm_idcliente = id;
	END IF;
END//
DELIMITER ;

