-- Volcando estructura para procedimiento valorizacion.pa_crear_periodo
DROP PROCEDURE IF EXISTS `pa_crear_periodo`;
DELIMITER //
CREATE PROCEDURE `pa_crear_periodo`(IN `Periodopro` INT, IN `idUsuario` INT)
BEGIN
	
	DECLARE _inventario integer;
	DECLARE Periodo integer;	
	DECLARE _centro1 integer;	
	DECLARE _centro2 integer;
	DECLARE _producto integer;
	DECLARE _cant_ant decimal(10,4);
	DECLARE _cant_envi decimal(10,4);
	DECLARE _cant_inve decimal(10,4);
	
	select max(tm_idperiodo) into Periodo from tm_periodo where tm_idperiodo < Periodopro and Activo = 1;

	BEGIN
		DECLARE done BOOLEAN DEFAULT FALSE;
		
		DECLARE CPeriodo CURSOR FOR  
		
		SELECT a.td_idinventario, a.tm_idproducto, a.tm_idcencosto_ori, a.tm_idcencosto_des, a.tm_cant_inve from 
		td_idinventario a  where a.tm_idperiodo = Periodo and a.tm_cant_inve > 0 and  a.Activo = 1 ;

		DECLARE CONTINUE HANDLER FOR NOT FOUND SET done = TRUE;
	
		OPEN CPeriodo;
		
		   CPeriodo_loop: LOOP
	
			Fetch CPeriodo into _inventario, _producto, _centro1, _centro2, _cant_inve;
		        	
					IF `done` THEN 
		        		LEAVE CPeriodo_loop; 
		        	END IF; 
					
	     			`tm_idcencosto_des`, `tm_idproducto`, `tm_cant_ant`, `Activo`, 
	      			`IdUsuarioReg`, `FechaReg`, `IdUsuarioAct`, `FechaAct`) 
	    			VALUES (1, 1, Periodopro, _centro1, _centro1, idproducto, _cant_inve , 1, idUsuario, NOW(), idUsuario, NOW());
					
			END LOOP CPeriodo_loop;
		
		CLOSE CPeriodo;
	END;

END//
DELIMITER ;

