		SET tm_nombre_comercial = nombre_comercial, tm_razon_social = razon_social,  tm_direccion_fiscal = direccion_fiscal,  tm_descripcion_comercial = descripcion_comercial, tm_eslogan = eslogan, tm_codigo_fiscal = codigo_fiscal, tm_email = email, tm_telefono = telefono, tm_pagina_web = pagina_web, tm_observaciones = observaciones, tm_logo = logo, IdUsuarioAct = idusuario, FechaAct = NOW()
		WHERE tm_idempresa = idempresa;

