-- Volcando estructura para procedimiento valorizacion.pa_inventario_adicionar
DROP PROCEDURE IF EXISTS `pa_inventario_adicionar`;
DELIMITER //
CREATE PROCEDURE `pa_inventario_adicionar`(
	IN `idperiodo` int(11)










)
BEGIN
	DECLARE _idproducto INT(11);
	DECLARE flag INT(1);
	DECLARE _idcentrocosto INT(11);
	DECLARE idinventario INT(11);

	DECLARE cantidad INT(11);
	DECLARE _cant_envi DECIMAL(11,4);
	DECLARE costo DECIMAL(11,4);
	DECLARE val_cons DECIMAL(11,4);
	DECLARE cant_cons DECIMAL(11,4);

	UPDATE td_inventario SET tm_cant_envi = 0 WHERE tm_idperiodo = idperiodo and Activo = 1;

	BEGIN

		DECLARE done BOOLEAN DEFAULT FALSE;

		DECLARE CTotales CURSOR FOR  
			SELECT a.tm_cant_envi, b.tm_idproducto as codpro, c.tm_idcencosto as codcos from tmp_inventario as a  
			inner join tm_producto as b on a.tm_codpro_star = b.tm_codpro_star 
			inner join tm_centrocosto as c on a.tm_cencos_star = c.tm_descripcion ; 
				
		DECLARE CONTINUE HANDLER FOR NOT FOUND SET done = TRUE;
	
		OPEN CTotales;
		
		   CTotales_loop: LOOP
	
			Fetch CTotales into _cant_envi, _idproducto, _idcentrocosto ;
		        	
					IF `done` THEN 
		        		LEAVE CTotales_loop; 
		        	END IF; 

					SELECT tm_costo INTO costo FROM tm_costo_producto WHERE tm_idproducto = _idproducto AND tm_idperiodo = idperiodo AND Activo = 1;
		
					SELECT b.tm_flagedicion into flag FROM tm_producto as a 
						 inner join tm_familia  as b on a.tm_idfamilia = b.tm_idfamilia 
				 	WHERE tm_idproducto = _idproducto AND a.Activo = 1 ; 	
		
					SET cant_cons = _cant_envi;
					SET val_cons = cant_cons * costo ;
		
		
					SELECT td_idinventario, count(*) INTO idinventario, cantidad FROM td_inventario WHERE tm_idcencosto_ori = _idcentrocosto 
					AND tm_idproducto = _idproducto AND tm_idperiodo = idperiodo AND Activo = 1;

		 			IF cantidad > 0 THEN
		 				UPDATE td_inventario SET tm_cant_envi = tm_cant_envi+_cant_envi, tm_cant_cons = cant_cons, tm_val_cons = val_cons, IdUsuarioAct = 1, FechaAct = NOW() WHERE td_idinventario  = idinventario;
		 			ELSE
			      		tm_idcencosto_des, tm_idproducto, tm_cant_ant, tm_cant_envi,  tm_cant_reen, tm_cant_reci, tm_cant_inve, 
							tm_cant_cons, tm_val_cons, Activo, IdUsuarioReg, FechaReg, IdUsuarioAct, FechaAct) 
			    		VALUES (1, 1, idperiodo, _idcentrocosto, _idcentrocosto, _idproducto, 0, _cant_envi, 0, 0, 0, cant_cons, val_cons, 1, 1, NOW(), 1, NOW());					
					END IF;			
			END LOOP CTotales_loop;
		
		CLOSE CTotales;
	END;
END//
DELIMITER ;

