CREATE PROCEDURE `pa_inventario_reporte`(
	IN `periodo1` INT(11),
	IN `periodo2` INT(11)


)
BEGIN
  	 SELECT f.tm_descripcion as periodo, b.tm_descripcion as CentroCosto, e.tm_descripcion as TipoFamilia, d.tm_descripcion as Familia, c.tm_descripcion as Producto, a.tm_cant_cons as cantidad, g.tm_costo as costo , a.tm_val_cons as valor FROM td_inventario as a 
	 inner join tm_centrocosto as b on a.tm_idcencosto_des = b.tm_idcencosto
	 inner join tm_producto  as c on a.tm_idproducto = c.tm_idproducto
	 inner join tm_familia  as d on c.tm_idfamilia = d.tm_idfamilia 
	 inner join tm_tipo_familia  as e on d.tm_idtipofamilia = e.tm_idtipofamilia 	
	 inner join tm_periodo as f on a.tm_idperiodo = f.tm_idperiodo 
	 inner join tm_costo_producto as g on a.tm_idproducto = g.tm_idproducto and a.tm_idperiodo = g.tm_idperiodo 
	 WHERE a.tm_idempresa = 1 AND a.tm_idcentro = 1 AND (a.tm_idperiodo >= periodo1 AND a.tm_idperiodo <= periodo2) AND a.Activo = 1 ORDER BY 1,2,3,4,5 
	 INTO OUTFILE 'D:/inventario.csv'
   	FIELDS TERMINATED BY ','
    	OPTIONALLY ENCLOSED BY '\"'
    	LINES TERMINATED BY '\n';
END//
DELIMITER ;

