begin
	if tipo = 'CONFIG' then
		select IFNULL(b.td_idperfilemnu, 0) as idperfilmenu, 
			a.tm_idmenu, a.tm_idmenuref, a.tm_titulo, tmenu.ta_denominacion AS tipomenu
		from tm_menu as a
			INNER JOIN ta_tabla AS tmenu ON a.ta_tipomenu = tmenu.ta_codigo AND tmenu.ta_campo = 'ta_tipomenu'
			left join td_perfilmenu as b on a.tm_idmenu = b.tm_idmenu and b.tm_idperfil = idperfil 
		and b.tm_idempresa = idempresa and b.tm_idcentro = idcentro
		WHERE a.Activo = 1;
	elseif tipo = 'HOME' then
		SELECT a.tm_idmenu, a.tm_titulo, a.tm_cabecera, a.tm_descripcion, a.tm_iconbgcolor, a.ta_tipoicon, a.ta_tamanho, a.tm_iconuri, a.tm_uri, a.tm_idmenuref
		FROM tm_menu as a
			inner join td_perfilmenu as b on a.tm_idmenu = b.tm_idmenu
		WHERE a.tm_idmenuref = idreferencia
			and a.ta_tipomenu = tipomenu
			and a.Activo = 1 and b.tm_idperfil = idperfil AND a.tm_esdesktop = 1
		order by a.tm_orden;
	end if;
end//
