-- Volcando estructura para procedimiento valorizacion.pa_periodo_adicionar
DROP PROCEDURE IF EXISTS `pa_periodo_adicionar`;
DELIMITER //
CREATE PROCEDURE `pa_periodo_adicionar`(
	IN `idperiodo` INT

)
BEGIN
	DECLARE _centroorigen INT(11);
	DECLARE _centrodestino INT(11);
	DECLARE _producto INT(11);
	DECLARE periodo INT(11);
	DECLARE _cantidad DECIMAL(11,4);

	SELECT max(tm_idperiodo) as periodo FROM td_inventario WHERE Activo = 1;

	BEGIN
	
		DECLARE done BOOLEAN DEFAULT FALSE;

		DECLARE CTotales CURSOR FOR  
		SELECT tm_idcencosto_ori, tm_idcencosto_des, tm_idproducto, tm_cant_inve from td_inventario 
		where tm_idperiodo = periodo and tm_cant_inve > 0 ; 
				
		DECLARE CONTINUE HANDLER FOR NOT FOUND SET done = TRUE;
	
		OPEN CTotales;
		
		   CTotales_loop: LOOP
	
			Fetch CTotales into _centroorigen, _centrodestino, _producto, _cantidad ;
		        	
					IF `done` THEN 
		        		LEAVE CTotales_loop; 
		        	END IF; 
						
			      `tm_idcencosto_des`, `tm_idproducto`, `tm_cant_ante`, `tm_cant_envi`, `tm_cant_reen`, `tm_cant_reci`, 
					`tm_cant_inve`, `tm_cant_cons`,`Activo`, 
			      `IdUsuarioReg`, `FechaReg`, `IdUsuarioAct`, `FechaAct`) 
			    VALUES (1, 1, periodo+1, idcencosto_ori, idcencosto_des, _producto, _cantidad, 0, 0, 0, 0, 0, 1, 1, NOW(), 1, NOW());						
								
			END LOOP CTotales_loop;
		
		CLOSE CTotales;
	END;
END//
DELIMITER ;

-- Volcando estructura para procedimiento valorizacion.pa_periodo_ajustar
DROP PROCEDURE IF EXISTS `pa_periodo_ajustar`;
DELIMITER //
CREATE PROCEDURE `pa_periodo_ajustar`(
	IN `idperiodo` INT(11)



)
BEGIN

	DECLARE _idinventario INT(11);
	
	BEGIN

		DECLARE done BOOLEAN DEFAULT FALSE;

		DECLARE CTotales CURSOR FOR

		SELECT td_idinventario from td_inventario where tm_idperiodo = idperiodo and Activo = 1 ; 
				
		DECLARE CONTINUE HANDLER FOR NOT FOUND SET done = TRUE;
	
		OPEN CTotales;
		
		   CTotales_loop: LOOP
	
			Fetch CTotales into _idinventario;
		        	
					IF `done` THEN 
		        		LEAVE CTotales_loop; 
		        	END IF; 
						
		        	UPDATE td_inventario set tm_cant_cons = tm_cant_ante + tm_cant_envi + tm_cant_reci - tm_cant_reen - tm_cant_inve 

		        	where td_idinventario = _idinventario;  
								
			END LOOP CTotales_loop;
		
		CLOSE CTotales;
	END;
END//
DELIMITER ;

