CREATE PROCEDURE `pa_producto_adicionar`()
BEGIN
	DECLARE _codstar varchar(12);
	DECLARE _familia varchar(100);
	DECLARE _descripcion varchar(200);
	DECLARE _codfam INT(11);

	BEGIN

		DECLARE done BOOLEAN DEFAULT FALSE;

		DECLARE CTotales CURSOR FOR  
		SELECT a.cod_starsoft, a.tm_descripcion, b.tm_idfamilia as codfam from tmp_productos as a  
			left outer join tm_familia as b on trim(a.tm_familia) = trim(b.tm_descripcion)  
		where a.cod_starsoft not in (select c.tm_codpro_star from tm_producto as c where c.Activo = '1'); 
				
		DECLARE CONTINUE HANDLER FOR NOT FOUND SET done = TRUE;
	
