			Fetch CTotales into _codstar, _descripcion, _codfam ;
		        	
					IF `done` THEN 
		        		LEAVE CTotales_loop; 
		        	END IF; 
						
					VALUES (1, 1, _codstar, _codfam, _descripcion, 1, 1, NOW(), 1, NOW());
					
			END LOOP CTotales_loop;
		
		CLOSE CTotales;
	END;
END//
