-- Volcando estructura para procedimiento valorizacion.pa_producto_listar
DROP PROCEDURE IF EXISTS `pa_producto_listar`;
DELIMITER //
CREATE PROCEDURE `pa_producto_listar`(
	IN `tipo` VARCHAR(10),
	IN `id` INT(11),
	IN `criterio` VARCHAR(150),
	IN `pagina` INT








)
BEGIN
	DECLARE firstLimit INT(11) DEFAULT 42;
	DECLARE vstart INT(11) DEFAULT 0;
  IF tipo = '1' THEN
	 set vstart = (pagina * firstLimit) - firstLimit;
    SELECT *  FROM tm_producto WHERE tm_descripcion LIKE CONCAT('%', criterio, '%') OR tm_codpro_star LIKE CONCAT('%', criterio, '%') AND Activo = 1
	 		ORDER BY tm_descripcion  
			LIMIT vstart, firstLimit;  
  ELSEIF tipo = '2' THEN
