CREATE PROCEDURE `pa_reenvio_eliminar`(
	IN `idreenvio` INT(11),
	IN `idusuario` INT(11),
	OUT `rpta` INT(11),
	OUT `titulomsje` VARCHAR(100),
	OUT `contenidomsje` VARCHAR(100)
)
BEGIN
  DECLARE inventario int(11);
  DECLARE cantidad decimal(11,4);  
  SELECT td_idventario, td_cant_envi INTO inventario, cantidad FROM td_reenvio WHERE td_idreenvio = idreenvio;  
  UPDATE td_inventario SET tm_cant_envi = tm_cant_envi + cantidad, tm_cant_reen = tm_cant_reen - cantidad, IdUsuarioAct = idusuario, FechaAct = NOW() WHERE td_idinventario = inventario;  
  UPDATE td_reenvio SET Activo = 0, IdUsuarioAct = idusuario, FechaAct = NOW() WHERE td_idreenvio = idreenvio;
  SET rpta = idreenvio;
  SET titulomsje = 'Eliminado correctamente';
  SET contenidomsje = 'La operación se completó satisfactoriamente';
END//
DELIMITER ;

