  DECLARE periodo  int(11);
  select tm_idperiodo into periodo from tm_periodo where ta_estado_periodo = '01';
  IF tipo = '1' THEN
  	 SELECT a.*, b.tm_descripcion as CentroCosto, c.tm_descripcion as Producto FROM td_reenvio as a 
	 inner join tm_centrocosto as b on a.tm_idcencosto_des = b.tm_idcencosto
	 inner join tm_producto as c on a.tm_idproducto = c.tm_idproducto
	 WHERE a.tm_idcencosto_ori = idcencosto_ori and a.tm_idperiodo = periodo and a.tm_idproducto = idproducto  AND a.Activo = 1 ; 
  ELSEIF tipo = '2' THEN
  	 SELECT a.*, b.tm_descripcion as CentroCosto, c.tm_descripcion as Producto  FROM td_reenvio as a 
	 inner join tm_centrocosto as b on a.tm_idcencosto_des = b.tm_idcencosto
	 inner join tm_producto as c on a.tm_idproducto = c.tm_idproducto
	 WHERE a.tm_idcencosto_des = idcencosto_des AND a.tm_idperiodo = periodo AND a.Activo = 1 ; 
  ELSEIF tipo = '3' THEN
  	 SELECT a.*, b.tm_descripcion as CentroCosto, c.tm_descripcion as Producto  FROM td_reenvio as a 
	 inner join tm_centrocosto as b on a.tm_idcencosto_ori = b.tm_idcencosto
	 inner join tm_producto as c on a.tm_idproducto = c.tm_idproducto
	 WHERE a.tm_idcencosto_ori = idcencosto_ori AND a.tm_idperiodo = periodo AND a.Activo = 1 ; 
