CREATE PROCEDURE `pa_usuario_acceder`(IN `usuario` VARCHAR(20), IN `clave` VARCHAR(40))
BEGIN
	SELECT a.*, perfil.tm_codigo AS codigoperfil, empresa.tm_nombre_comercial AS nombreempresa, COALESCE(b.idusuario, 0) AS idusuario_plataforma, COALESCE(b.datos_preliminares, 1) AS datos_preliminares, COALESCE(b.idciudad, '0') AS IdRegion
	FROM tm_usuario AS a
		INNER JOIN tm_perfil AS perfil ON a.tm_idperfil = perfil.tm_idperfil
		INNER JOIN tm_empresa AS empresa ON a.tm_idempresa = empresa.tm_idempresa 
		LEFT JOIN tm_usuario_plataforma AS b ON a.IdUsuarioReg = b.idusuario
	WHERE a.tm_login = usuario AND a.tm_clave = clave;
	
END//
DELIMITER ;

