begin
	IF tipo = 'CON-LOGIN' THEN
		IF (SELECT COUNT(*) FROM tm_usuario WHERE tm_idusuario = idusuario AND tm_clave = current_password) > 0 THEN
			UPDATE tm_usuario SET tm_clave = new_password WHERE tm_idusuario = idusuario;
			
			SET rpta = idusuario;
			SELECT 'La clave se ha cambiado correctamente' INTO titulomsje;
