			SELECT 'No se pudo completar la operación' INTO contenidomsje;
		END IF;
	ELSE
		UPDATE tm_usuario SET tm_clave = new_password WHERE tm_idusuario = idusuario;
		SET rpta = idusuario;
		SELECT 'La clave se ha cambiado correctamente' INTO titulomsje;
		SELECT 'La operación se realizo con éxito' INTO contenidomsje;
	END IF;
end//
