DROP PROCEDURE IF EXISTS `pa_usuario_listar`;
DELIMITER //
CREATE PROCEDURE `pa_usuario_listar`(IN `tipo` VARCHAR(10), IN `idempresa` INT(11), IN `idcentro` INT(11), IN `idusuario` INT(11), IN `criterio` VARCHAR(50), IN `pagina` INT(11))
BEGIN
	DECLARE firstLimit INT(11) DEFAULT 42;
	DECLARE vstart INT(11) DEFAULT 0;
	
	IF tipo = '1' THEN
		set vstart = (pagina * firstLimit) - firstLimit;
		
		SELECT a.*, b.tm_nombre as NomPerfil
		FROM tm_usuario as a
			inner join tm_perfil as b on a.tm_idperfil = b.tm_idperfil
		WHERE a.tm_login LIKE CONCAT('%', criterio, '%') AND a.tm_idempresa = idempresa AND a.tm_idcentro = idcentro
		AND a.Activo = 1
		LIMIT vstart, firstLimit;
	ELSEIF tipo = '2' THEN
		SELECT * FROM tm_usuario 
		WHERE tm_idusuario = idusuario;
	ELSEIF tipo = 'VAL' THEN
		SELECT tm_login FROM tm_usuario
		WHERE tm_login = criterio;
	ELSEIF tipo = '3' THEN
		SELECT u.*, 
			pais.tp_nombre AS nombre_pais
		FROM tm_usuario AS u
			INNER JOIN tp_pais AS pais ON u.tp_idpais = pais.tp_idpais
		WHERE u.tm_idusuario = idusuario AND u.Activo = 1;
	ELSEIF tipo = '4' THEN
		SELECT u.*
		FROM tm_usuario AS u
		WHERE u.tm_idusuario = idusuario;
	END IF;
END//
DELIMITER ;

-- Volcando estructura para procedimiento valorizacion.pa_usuario_plataforma_preliminar
DROP PROCEDURE IF EXISTS `pa_usuario_plataforma_preliminar`;
DELIMITER //
CREATE PROCEDURE `pa_usuario_plataforma_preliminar`(IN `_idusuario` INT, IN `idempresa` INT, IN `idcentro` INT, IN `pregunta` TINYINT(1), IN `idusuario_registrador` INT, OUT `rpta` INT(11), OUT `titulomsje` VARCHAR(100), OUT `contenidomsje` VARCHAR(100))
BEGIN
	DECLARE idempresa_default INT;
	DECLARE idcentro_default INT;
	DECLARE _datos_preliminares INT;

	DECLARE _idperfil_insertado INT(11);
	DECLARE _idcategoria_insertado INT(11);
	DECLARE _idcategoria_insumo_insertado INT(11);

	DECLARE _idproducto_insertado INT(11);
	DECLARE _idinsumo_insertado INT(11);

	DECLARE _idperfil INT(11);

	DECLARE _idcategoria_insumo INT(11);
	DECLARE _idcategoria_producto INT(11);
	DECLARE _tipocategoria VARCHAR(2);
	DECLARE _codigocat VARCHAR(3);
	DECLARE _codigocat_insumo VARCHAR(6);
	DECLARE _nombrecat VARCHAR(150);

	DECLARE _idproducto INT(11);
	DECLARE _codigo VARCHAR(10);
	DECLARE _nombre VARCHAR(150);
	DECLARE _idcategoria INT(11);
	DECLARE _idsubcategoria INT(11);
	DECLARE _idareadespacho INT(11);
	DECLARE _contenido VARCHAR(350);
	DECLARE _peso DECIMAL(15,3);
	DECLARE _foto VARCHAR(250);
	DECLARE _Abreviatura VARCHAR(20);
	DECLARE _precioVenta DECIMAL(15,2);
	DECLARE _precioSinImpuesto DECIMAL(15,2);
	DECLARE _porcentajeImpuesto DECIMAL(15,2);
	DECLARE _idalmacen INT(11);
	DECLARE _tienereceta TINYINT(1);
	DECLARE _factor INT(11);
	DECLARE _esagregado TINYINT(1);
	DECLARE _nroporciones INT(11);
	DECLARE _idunidadmedida INT(11);

	DECLARE _idinsumo INT(11);
	DECLARE _tipo_insumo VARCHAR(2);
	DECLARE _descripcion VARCHAR(350);
	DECLARE _stock_min DECIMAL(15,3);
	DECLARE _stock_max DECIMAL(15,3);
	DECLARE _stock_ideal DECIMAL(15,3);
	DECLARE _stock DECIMAL(15,3);
	DECLARE _idGrupoInsumo INT(11);
	DECLARE _ultimoCosto DECIMAL(15,2);
	DECLARE _costoPromedio DECIMAL(15,2);
	DECLARE _porImpuesto DECIMAL(15,2);
	DECLARE _costoconImpuesto DECIMAL(15,2);
	DECLARE _inventario TINYINT(4);
	DECLARE _porMerma DECIMAL(15,2);
	DECLARE _ultimoCostoMerma DECIMAL(15,2);

	SELECT CAST(ta_defvalue AS UNSIGNED) INTO idempresa_default FROM ta_default WHERE ta_idcampo = 'idempresa_default';
	SELECT CAST(ta_defvalue AS UNSIGNED) INTO idcentro_default FROM ta_default WHERE ta_idcampo = 'idcentro_default';

	BEGIN
		DECLARE done BOOLEAN DEFAULT FALSE;
		DECLARE cursorPerfiles CURSOR FOR
			SELECT tm_idperfil, tm_codigo, tm_nombre, tm_descripcion, tm_abreviatura FROM tm_perfil 
			WHERE tm_idempresa = idempresa_default AND tm_idcentro = idcentro_default AND Activo = 1;
		DECLARE CONTINUE HANDLER FOR SQLSTATE '02000' SET done = TRUE;

		OPEN cursorPerfiles;
			cPerfiles_loop: LOOP
				FETCH cursorPerfiles INTO _idperfil, _codigo, _nombre, _descripcion, _Abreviatura;

					IF done THEN
						LEAVE cPerfiles_loop;
					END IF;

					VALUES (idempresa, idcentro, _codigo, _nombre, _descripcion, _Abreviatura, 1, idusuario_registrador, NOW(), idusuario_registrador, NOW());

					SELECT LAST_INSERT_ID() INTO _idperfil_insertado;

					SELECT idempresa, idcentro, _idperfil_insertado, tm_idmenu, idusuario_registrador, NOW(), idusuario_registrador, NOW() FROM td_perfilmenu
					WHERE tm_idempresa = idempresa_default AND tm_idcentro = idcentro_default;

			END LOOP cPerfiles_loop;
		CLOSE cursorPerfiles;
	END;

	SET _datos_preliminares = 1;

		SELECT 0, `ta_tipocategoria`, idempresa, idcentro, `tm_codigo`, `tm_nombre`, 1, idusuario_registrador, NOW(), idusuario_registrador, NOW() FROM tm_categoria WHERE tm_idempresa = idempresa_default AND tm_idcentro = idcentro_default AND Activo = 1;


	SELECT idempresa, idcentro, `tm_nombre`, `tm_abreviatura`, 1, idusuario_registrador, NOW(), idusuario_registrador, NOW() FROM tm_unidad_medida WHERE tm_idempresa = idempresa_default AND tm_idcentro = idcentro_default AND Activo = 1;


	SELECT idempresa, idcentro, `tm_codigo`, `tm_nombre`, `Abreviatura`, 1, idusuario_registrador, NOW(), idusuario_registrador, NOW() FROM tm_presentacion WHERE tm_idempresa = idempresa_default AND tm_idcentro = idcentro_default AND Activo = 1;

	SELECT idempresa, idcentro, `tm_codigo`, `tm_nombre`, `tm_descripcion`, `CodigoSunat`, `tm_porcjimpuesto`, `Abreviatura`, 1, idusuario_registrador, NOW(), idusuario_registrador, NOW() FROM tm_tipo_comprobante WHERE tm_idempresa = idempresa_default AND tm_idcentro = idcentro_default AND Activo = 1;
		
	IF pregunta = 1 THEN 
		BEGIN
			DECLARE done BOOLEAN DEFAULT FALSE;
			DECLARE cursorInsumos CURSOR FOR
				SELECT ins.tm_idinsumo, ins.tm_idcategoria, ins.tm_idsubcategoria, ins.ta_tipo_insumo, ins.tm_nombre, ins.tm_descripcion, ins.Abreviatura, ins.tm_stock_min, ins.tm_stock_max, ins.tm_stock_ideal, ins.tm_stock, ins.tm_idGrupoInsumo, ins.tm_ultimoCosto, ins.tm_costoPromedio, ins.tm_porImpuesto, ins.tm_costoconImpuesto, ins.tm_inventario, ins.tm_porMerma, ins.tm_ultimoCostoMerma, ins.tm_idunidadmedida, COALESCE(catins.tm_idcategoria_insumo, 0), COALESCE(catins.tm_codigo, ''), COALESCE(catins.tm_nombre, '')
				FROM tm_insumo AS ins
					LEFT JOIN tm_categoria_insumo AS catins ON ins.tm_idcategoria = catins.tm_idcategoria_insumo
				WHERE ins.tm_idempresa = idempresa_default AND ins.tm_idcentro = idcentro_default 
				
				
				And ins.Activo = 1;
			DECLARE CONTINUE HANDLER FOR SQLSTATE '02000' SET done = TRUE;

			OPEN cursorInsumos;
				cInsumos_loop: LOOP
					FETCH cursorInsumos INTO _idinsumo, _idcategoria, _idsubcategoria, _tipo_insumo, _nombre, _descripcion, _Abreviatura, _stock_min, _stock_max, _stock_ideal, _stock, _idGrupoInsumo, _ultimoCosto, _costoPromedio, _porImpuesto, _costoconImpuesto, _inventario, _porMerma, _ultimoCostoMerma, _idunidadmedida, _idcategoria_insumo, _codigocat_insumo, _nombrecat;
						
						IF done THEN 
							LEAVE cInsumos_loop;
						END IF;

						SET _idcategoria_insumo_insertado = _idcategoria_insumo;

						IF _idcategoria_insumo > 0 THEN
							IF (SELECT COUNT(*) FROM tm_categoria_insumo WHERE tm_idempresa = idempresa AND tm_idcentro = idcentro
								AND tm_nombre = _nombrecat) = 0 THEN
								
								VALUES (idempresa, idcentro, _codigocat_insumo, _nombrecat, 1, idusuario_registrador, NOW(), idusuario_registrador, NOW());
								
								SELECT LAST_INSERT_ID() INTO _idcategoria_insumo_insertado;
							END IF;
						END IF;

						VALUES (_idinsumo, idempresa, idcentro, _idcategoria_insumo_insertado, _idsubcategoria, _tipo_insumo, _nombre, _descripcion, '00', _Abreviatura, _stock_min, _stock_max, _stock_ideal, _stock, _idGrupoInsumo, _ultimoCosto, _costoPromedio, _porImpuesto, _costoconImpuesto, _inventario, _porMerma, _ultimoCostoMerma, _idunidadmedida, 1, idusuario_registrador, NOW(), idusuario_registrador, NOW());

						SELECT LAST_INSERT_ID() INTO _idinsumo_insertado;

						SELECT idempresa, idcentro, _idinsumo_insertado, tm_idpresentacion, tm_idunidadmedida, td_medida, ta_tipoinsumo, 1, idusuario_registrador, NOW(), idusuario_registrador, NOW()
						FROM td_presentacion_insumo WHERE tm_idinsumo = _idinsumo AND Activo = 1;

				END LOOP cInsumos_loop;
			CLOSE cursorInsumos;
		END;

		BEGIN
			DECLARE done BOOLEAN DEFAULT FALSE;
			DECLARE cursorArticulos CURSOR FOR
				SELECT prod.tm_idproducto, prod.tm_codigo, prod.tm_nombre, prod.tm_idcategoria, prod.tm_idsubcategoria, prod.tm_idareadespacho, prod.td_contenido, prod.tm_peso, prod.tm_foto, prod.Abreviatura, prod.tm_precioVenta, prod.tm_precioSinImpuesto, prod.tm_porcentajeImpuesto, prod.tm_idalmacen, prod.tm_tienereceta, prod.tm_factor, prod.tm_esagregado, prod.tm_nroporciones, prod.tm_idunidadmedida, COALESCE(catprod.tm_idcategoria, 0), COALESCE(catprod.ta_tipocategoria, '00'), COALESCE(catprod.tm_codigo, ''), COALESCE(catprod.tm_nombre, '')
				FROM tm_producto AS prod
					LEFT JOIN tm_categoria AS catprod ON prod.tm_idcategoria = catprod.tm_idcategoria
				WHERE prod.tm_idempresa = idempresa_default AND prod.tm_idcentro = idcentro_default
				AND prod.Activo = 1;
			DECLARE CONTINUE HANDLER FOR SQLSTATE '02000' SET done = TRUE;

			OPEN cursorArticulos;
				cArticulos_loop:LOOP
					FETCH cursorArticulos INTO _idproducto, _codigo, _nombre, _idcategoria, _idsubcategoria, _idareadespacho, _contenido, _peso, _foto, _Abreviatura, _precioVenta, _precioSinImpuesto, _porcentajeImpuesto, _idalmacen, _tienereceta, _factor, _esagregado, _nroporciones, _idunidadmedida, _idcategoria_producto, _tipocategoria, _codigocat, _nombrecat;

						IF done THEN
							LEAVE cArticulos_loop;
						END IF;

						SET _idcategoria_insertado = _idcategoria;

						IF _idcategoria_producto > 0 THEN
							IF (SELECT COUNT(*) FROM tm_categoria WHERE tm_idempresa = idempresa AND tm_idcentro = idcentro
								AND tm_nombre = _nombrecat) = 0 THEN
								
								VALUES (idempresa, idcentro, _tipocategoria, _codigocat, _nombrecat, 1, idusuario_registrador, NOW(), idusuario_registrador, NOW());
								
								SELECT LAST_INSERT_ID() INTO _idcategoria_insertado;
							END IF;
						END IF;

						VALUES (idempresa, idcentro, _codigo, _nombre, _idcategoria_insertado, _idsubcategoria, _idareadespacho, _contenido, _peso, _foto, _Abreviatura, _precioVenta, _precioSinImpuesto, _porcentajeImpuesto, _idalmacen, _tienereceta, _factor, _esagregado, _nroporciones, _idunidadmedida, 1, idusuario_registrador, NOW(), idusuario_registrador, NOW());

						SELECT LAST_INSERT_ID() INTO _idproducto_insertado;

						SELECT idempresa, idcentro, _idproducto_insertado, ins.tm_idinsumo, r.tm_idunidadmedida, r.ta_tipomenudia, r.ta_tipoinsumo, r.td_descripcion, r.td_cantidad, r.td_nroporciones, r.td_avgxporcion, r.td_precio, r.td_subtotal, 1, idusuario_registrador, NOW(), idusuario_registrador, NOW()
						FROM td_receta AS r
							INNER JOIN (
								SELECT tm_idinsumo, tp_idinsumo, Activo
								FROM tm_insumo WHERE tm_idempresa = idempresa AND tm_idcentro = idcentro AND Activo = 1
							) AS ins ON r.tm_idinsumo_orig = ins.tp_idinsumo
						WHERE r.tm_idempresa = idempresa_default AND r.tm_idcentro = idcentro_default AND r.tm_idproducto = _idproducto AND r.Activo = 1;

				END LOOP cArticulos_loop;
			CLOSE cursorArticulos;
		END;
	END IF;
	
	UPDATE tm_usuario_plataforma SET datos_preliminares = _datos_preliminares, IdUsuarioAct = idusuario_registrador, FechaAct = NOW() WHERE idusuario = _idusuario;

	SELECT _idusuario INTO rpta;
	SET titulomsje = 'Importado correctamente';
	SET contenidomsje = 'La operación se completó satisfactoriamente';
END//
DELIMITER ;

-- Volcando estructura para procedimiento valorizacion.pa_usuario_plataforma_registrar
DROP PROCEDURE IF EXISTS `pa_usuario_plataforma_registrar`;
DELIMITER //
CREATE PROCEDURE `pa_usuario_plataforma_registrar`(IN `_login` VARCHAR(50), IN `_clave` VARCHAR(32), IN `_esempresa` INT, IN `_idciudad` INT, IN `_numerodoc` VARCHAR(20), IN `_razonsocial` VARCHAR(200), IN `_nombres` VARCHAR(150), IN `_apellidos` VARCHAR(150), IN `_email` VARCHAR(100), IN `idusuario_registrador` INT, OUT `rpta` INT(11), OUT `titulomsje` VARCHAR(100), OUT `contenidomsje` VARCHAR(100))
BEGIN
	DECLARE idperfil INT;
	DECLARE idtipodoc INT;
	DECLARE idusuario_plataforma INT;

	DECLARE nrodni VARCHAR(2);
	DECLARE nroruc VARCHAR(2);
	DECLARE _nombre_empresa VARCHAR(350);

	DECLARE _idempresa INT;
	DECLARE _idcentro INT;

	SET nrodni = '';
	SET nroruc = '';
	
	SELECT CAST(ta_defvalue AS UNSIGNED) INTO idperfil FROM ta_default WHERE ta_idcampo = 'idperfiladmin_default';

	SELECT CAST(ta_defvalue AS UNSIGNED) INTO idtipodoc FROM ta_default WHERE ta_idcampo = CASE _esempresa WHEN 1 THEN 'idtipodoc_jur_default' ELSE 'idtipodoc_nat_default' END;
	
	IF _esempresa = 1 THEN
		SET nroruc = _numerodoc;
		SET _nombre_empresa = _razonsocial;
	ELSE
		SET nrodni = _numerodoc;
		SET _nombre_empresa = CONCAT(_nombres, ' ', _apellidos);
	END IF;

		VALUES (_login, _clave, _idciudad, _numerodoc, _razonsocial, _nombres, _apellidos, _email, _esempresa, 1, idusuario_registrador, NOW(), idusuario_registrador, NOW());
		
	SELECT LAST_INSERT_ID() INTO idusuario_plataforma;

	VALUES (_nombre_empresa, _nombre_empresa, _numerodoc,_email, 1, 1, idusuario_plataforma, NOW(), idusuario_plataforma, NOW());

	SELECT LAST_INSERT_ID() INTO _idempresa;
	
	VALUES (_idempresa, 'SEDE CENTRAL', 1, idusuario_plataforma, NOW(), idusuario_plataforma, NOW());

	SELECT LAST_INSERT_ID() INTO _idcentro;

	VALUES (_idempresa, _idcentro, idperfil, 0, '03', _login, _clave, _nombres, _apellidos, nrodni, nroruc, _email, 'no-set', 0, idusuario_plataforma, NOW(), idusuario_plataforma, NOW());

	SELECT LAST_INSERT_ID() INTO rpta;

	VALUES (idperfil, rpta, 1, idusuario_plataforma, NOW(), idusuario_plataforma, NOW());
END//
DELIMITER ;

-- Volcando estructura para procedimiento valorizacion.pa_usuario_plataforma_registrar__standalone
DROP PROCEDURE IF EXISTS `pa_usuario_plataforma_registrar__standalone`;
DELIMITER //
CREATE PROCEDURE `pa_usuario_plataforma_registrar__standalone`(IN `idcliente` INT, IN `_login` VARCHAR(50), IN `_clave` VARCHAR(32), IN `_esempresa` INT, IN `_idciudad` INT, IN `_numerodoc` VARCHAR(32), IN `_razonsocial` VARCHAR(200), IN `_nombres` VARCHAR(150), IN `_apellidos` VARCHAR(150), IN `_email` VARCHAR(100), IN `idusuario_registrador` INT, OUT `rpta` INT(11), OUT `titulomsje` VARCHAR(100), OUT `contenidomsje` VARCHAR(100))
BEGIN
	IF ( SELECT COUNT(*)	FROM tm_usuario AS a INNER JOIN tm_usuario_plataforma AS b ON a.IdUsuarioReg = b.idusuario
		WHERE a.tm_idpersona = idcliente AND a.ta_tipopersona = '00' AND a.Activo = 1	) > 0 THEN
		SET rpta = 0;
		SET titulomsje = 'Ya existe el usuario para este cliente';
		SET contenidomsje = 'La operación se completó satisfactoriamente';
	ELSE
		SELECT LAST_INSERT_ID() INTO rpta;
		SET titulomsje = 'Registrado correctamente';
		SET contenidomsje = 'La operación se completó satisfactoriamente';
	END IF;
	
END//
DELIMITER ;

-- Volcando estructura para procedimiento valorizacion.pa_usuario_registrar
DROP PROCEDURE IF EXISTS `pa_usuario_registrar`;
DELIMITER //
CREATE PROCEDURE `pa_usuario_registrar`(
	IN `idusuario` INT,
	IN `idempresa` INT,
	IN `idcentro` INT,
	IN `idperfil` INT,
	IN `idpersona` INT,
	IN `tipopersona` VARCHAR(2),
	IN `codigo` VARCHAR(12),
	IN `login` VARCHAR(50),
	IN `nombres` VARCHAR(150),
	IN `apellidos` VARCHAR(150),
	IN `clave` VARCHAR(32),
	IN `sexo` VARCHAR(2),
	IN `nrodni` VARCHAR(10),
	IN `nroruc` VARCHAR(20),
	IN `idpais` INT,
	IN `direccion` VARCHAR(150),
	IN `email` VARCHAR(100),
	IN `telefono` VARCHAR(100),
	IN `foto` VARCHAR(400),
	IN `modulo` VARCHAR(30),
	IN `idusuarioregistrador` INT,
	IN `idcentrocosto` INT,
	OUT `rpta` INT(11),
	OUT `titulomsje` VARCHAR(100),
	OUT `contenidomsje` VARCHAR(100)





)
BEGIN
	DECLARE _idusuario INT;
	
	IF modulo = 'CLIENTES' THEN
		IF (SELECT COUNT(*) FROM tm_usuario WHERE tm_idpersona = idpersona AND ta_tipopersona = '00' AND Activo = 1) >  0 THEN
			SELECT tm_idusuario INTO _idusuario FROM tm_usuario AS a WHERE a.tm_idpersona = idpersona AND a.ta_tipopersona = '00' AND a.Activo = 1;
		ELSE
			SET _idusuario = idusuario;
		END IF;
	ELSE
		SET _idusuario = idusuario;
	END IF;
	
	IF _idusuario = 0 THEN
		VALUES (idempresa, idcentro, idperfil, idpersona, '03', codigo, login, nombres, clave, apellidos, sexo, nrodni, nroruc, idpais, direccion, email, telefono, foto, idcentrocosto, 1, idusuarioregistrador, NOW(), idusuarioregistrador, NOW());
		
		SELECT LAST_INSERT_ID() INTO rpta;

		VALUES (idperfil, idusuario, 1, idusuario, NOW(), idusuario, NOW());
		
		SET titulomsje = 'Registrado correctamente';
	ELSE		
		UPDATE tm_usuario 
		SET `tm_idempresa` = idempresa, `tm_idcentro` = idcentro, `tm_idperfil` = idperfil , `tm_idpersona` = idpersona, `ta_tipopersona` = '03', `tm_login` = login, `tm_nombres` = nombres, `tm_apellidos` = apellidos, `tm_sexo` = sexo, `tm_nrodni` = nrodni, `tm_nroruc` = nroruc, `tp_idpais` = idpais, `tm_direccion` = direccion, `tm_email` = email, `tm_telefono` = telefono, `tm_foto` = foto,  `tm_idcencosto` = idcentrocosto, `IdUsuarioAct` = idusuarioregistrador, `FechaAct` = NOW()
		WHERE tm_idusuario = _idusuario;

		SELECT _idusuario INTO rpta;
		SET titulomsje = 'Editado correctamente';
	END IF;

	SET contenidomsje = 'La operación se completó satisfactoriamente';
END//
DELIMITER ;

-- Volcando estructura para procedimiento valorizacion.WhileLoopProc
DROP PROCEDURE IF EXISTS `WhileLoopProc`;
DELIMITER //
CREATE PROCEDURE `WhileLoopProc`()
BEGIN
               DECLARE x  INT;
               DECLARE str  VARCHAR(255);
               SET x = 1;
               SET str =  '';
               WHILE x  <= 5 DO
                           SET  str = CONCAT(str,x,',');
                           SET  x = x + 1; 
               END WHILE;
               SELECT str;
       END//
DELIMITER ;

-- Volcando estructura para función valorizacion.fu_tipomovcaja_obtenerid
DROP FUNCTION IF EXISTS `fu_tipomovcaja_obtenerid`;
DELIMITER //
CREATE FUNCTION `fu_tipomovcaja_obtenerid`(`codigo` VARCHAR(5)) RETURNS int(11)
BEGIN
	DECLARE id INT(11) DEFAULT '';	
   SELECT tm_idtipomovimiento_caja INTO id
		FROM tm_tipomovimiento_caja WHERE tm_codigo = codigo;
   RETURN id;
END//
DELIMITER ;

-- Volcando estructura para función valorizacion.fu_vigencia
DROP FUNCTION IF EXISTS `fu_vigencia`;
DELIMITER //
CREATE FUNCTION `fu_vigencia`(`idcliente` INT) RETURNS tinyint(1)
BEGIN
   DECLARE id tinyint(1) DEFAULT 0;	
   SELECT case 
   		when date(a.tm_fechafinal) < curdate() then 1 
   		when date(a.tm_fechafinal) = curdate() then 2
   			else 
   				case when datediff(a.tm_fechafinal, now())  <= b.tm_dias_vencimiento then 3 
						else 4 
					end
   		end
	into id
	FROM td_servicio_cliente as a 
		inner join tm_servicio as b on a.tm_idservicio = b.tm_idservicio
		WHERE a.tm_idcliente = idcliente AND a.activo = 1 AND a.tm_estado = 1 and b.activo = 1  AND  b.tm_membresia = 1;
   RETURN id;
END//
DELIMITER ;

-- Volcando estructura para función valorizacion.GeneraNroAtencion
DROP FUNCTION IF EXISTS `GeneraNroAtencion`;
DELIMITER //
CREATE FUNCTION `GeneraNroAtencion`(`idempresa` INT(11), `idcentro` INT(11)) RETURNS varchar(12) CHARSET latin1
BEGIN
	DECLARE nroatencion VARCHAR(12) DEFAULT '';
   SELECT CONCAT('A', LPAD(COUNT(tm_idatencion) + 1,10,0)) INTO nroatencion
		FROM tm_atencion 
		WHERE DATE(tm_fechahora) = DATE(NOW()) AND tm_idempresa = idempresa AND tm_idcentro = idcentro;
    RETURN nroatencion;
